import React from 'react';

import styles from './TileItem.module.css';

export default ({ appointment_id, start_time, available_resource_id, handleClick }) => {
	const departments = JSON.parse(localStorage.getItem('schedule'))['departments']
	const doctors = Object.assign(...Object.values(departments).map(x => x['doctors']))
	const metaDoctor = doctors[available_resource_id]
	console.log(metaDoctor)
	return (
  	<li className={styles.row}> 
			<div className={styles.text}>
					{appointment_id + '\t' + metaDoctor.firstName + '\t' + metaDoctor.middleName + '\t' + metaDoctor.lastName + '\t' + start_time}
			</div>
		</li>
	);
};

